script: |
  super -f text -I q13045.spq | sort > q13045.out

inputs:
  - name: q13045.spq
    data: |
      SELECT DISTINCT - col2 * ( + 11 ) AS col0 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT 4 BETWEEN col0 * - + 79 * - - col1 + - 25 AND - ( + + col0 ) * 72 - - col1 - - col1;
  - name: tab0

outputs:
  - name: q13045.out
    data: |
      -1089
      -110
      -517
